@EU_Commission A 'package' weighs 80 kilos. It is able to move itself through an emission-free private vehicle of less than 20 kilos.

But it opts for a large private vehicle of 1200 kilos on fossil fuel.

What a world.

@EU_Commission The EU Superstate aspirations continue.
You will no longer patrol your own coasts - that will be the responsibility of the EU.
This lot are just power-mad.
